import React from "react";
import {
  View,
  Text,
  StyleSheet,
  TextInput,
  TouchableOpacity,
} from "react-native";
import { createStackNavigator } from "@react-navigation/stack";
import { createDrawerNavigator } from "@react-navigation/drawer";
import ClientHome from "./DrawerScreens/ClientHome";
import ProviderHome from "./DrawerScreens/ProviderHome";

const Stack = createStackNavigator();
const Drawer = createDrawerNavigator();

const ClientStack = ({ navigation }) => {
  return (
    <Stack.Navigator initialRouteName="ClientHome">
      <Stack.Screen
        name="ClientHome"
        component={ClientHome}
        options={{
          title: "ClientHome",
          headerLeft: () => (
            <NavigationDrawerHeader navigationProps={navigation} />
          ),
          headerStyle: {
            backgroundColor: "#307ecc",
          },
          headerTintColor: "#fff",
          headerTitleStyle: {
            fontWeight: "bold",
          },
        }}
      />
    </Stack.Navigator>
  );
};

const ProviderStack = ({ navigation }) => {
  return (
    <Stack.Navigator
      initialRouteName="ProviderHome"
      screenOptions={{
        headerLeft: () => (
          <NavigationDrawerHeader navigationProps={navigation} />
        ),
        headerStyle: {
          backgroundColor: "#307ecc",
        },
        headerTintColor: "#fff",
        headerTitleStyle: {
          fontWeight: "bold",
        },
      }}
    >
      <Stack.Screen
        name="ProviderHome"
        component={ProviderHome}
        options={{ title: "ProviderHome" }}
      />
    </Stack.Navigator>
  );
};
const DrawerNavigatorRoutes = (props) => {
  return (
    <Drawer.Navigator>
      <Text>Hello From DrawerNavigationRoutes</Text>
    </Drawer.Navigator>
  );
};

export default DrawerNavigatorRoutes;
